          <Typography style={{fontSize:34, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, textAlign:'center'}} variant={'h1'}>Browse through Neighborhoods in Austin</Typography>
          <div container style={{maxHeight:500, overflowY:'hidden', display:'flex'}}>
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
            <div style={{overflow:'hidden', width:300, paddingRight:5}}><Image src={testPhoto} style={{objectFit:''}}></Image></div>  
          </div>
        </div>
      );
    };
  }

export default windowSize(Property);
